description:
Dragon Box raw + Ocean uncut dub + Funimation original-bgm dub + AB Group &quot;Big Green&quot; dub + Funimation AND Pioneer English subtitles for Japanese audio.  The Dragon Box movies are in the theatrical animation ratio (1.80:1), not the production aspect ratio (4:3).

This is the same movie known as &quot;[The] Tree of Might&quot; on Funi's dubs (including the Pioneer release), and as &quot;Super Battle in the World&quot; in Europe.  A more accurate translation would be &quot;Super Deciding Battle for the Planet Earth.&quot;

1100 kbps h.264 + 128+128+128+128 kbps m4a.
